import * as axios from "axios";

const proxyAdress = "http://localhost:3001/api";

const auth = (login, password) => {
  const obj = {
    username: login,
    password: password,
  };
  console.log(obj);
  axios.post(proxyAdress + "/login", obj).then((res) => {
    console.log(res);
  });
};
export default auth;
